func TestExtractAuthz(t *testing.T) {
	defer CleanupTestData(Conn)
	iscnIdPrefixA := "iscn://testing/ISCNAAAAAA"
	iscnIdPrefixB := "iscn://testing/ISCNBBBBBB"
	iscnIdA1 := iscnIdPrefixA + "/1"
	iscnIdB1 := iscnIdPrefixB + "/1"
	ipld := "ipldxxxxxxxxxx"
	timestamp := time.Unix(123456789, 0)
	recordNotes := "record notes"
	stakeholdersA := []Stakeholder{
		{
			Entity: Entity{Id: "@Apple", Name: "Apple"},
			Data:   []byte(`{"entity":{"id":"@Apple","name":"Apple"},"contributionType":"http://schema.org/author","rewardProportion":9}`),
		},
	}
	stakeholdersB := []Stakeholder{
		{
			Entity: Entity{Id: "@Boy", Name: "Boy"},
			Data:   []byte(`{"entity":{"id":"@Boy","name":"Boy"},"contributionType":"http://schema.org/publisher","rewardProportion":1}`),
		},
	}
	contentMetadata := `{"a": "b", "c": "d"}`
	fingerprintsA := []string{`hash://testing/AAAAAAAAAA`}
	fingerprintsB := []string{`hash://testing/BBBBBBBBBB`}
	txs := []string{
		fmt.Sprintf(
			`{"height":"1234","txhash":"AAAAAA","tx":{"body":{"messages":[{"@type":"/cosmos.authz.v1beta1.MsgExec","grantee":"%[1]s","msgs":[{"@type":"/likechain.iscn.MsgCreateIscnRecord","from":"%[2]s","record":{"recordNotes":"%[3]s","contentFingerprints":["%[4]s"],"stakeholders":[%[5]s],"contentMetadata":%[6]s}},{"@type":"/likechain.iscn.MsgCreateIscnRecord","from":"%[2]s","record":{"recordNotes":"%[7]s","contentFingerprints":["%[8]s"],"stakeholders":[%[9]s],"contentMetadata":%[10]s}}]}],"memo":"AAAAAA"}},"logs":[{"msg_index":0,"log":"","events":[{"type":"iscn_record","attributes":[{"key":"iscn_id","value":"%[11]s"},{"key":"iscn_id_prefix","value":"%[12]s"},{"key":"owner","value":"%[2]s"},{"key":"ipld","value":"%[13]s"},{"key":"authz_msg_index","value":"0"},{"key":"iscn_id","value":"%[14]s"},{"key":"iscn_id_prefix","value":"%[15]s"},{"key":"owner","value":"%[2]s"},{"key":"ipld","value":"%[16]s"},{"key":"authz_msg_index","value":"1"}]},{"type":"message","attributes":[{"key":"action","value":"/cosmos.authz.v1beta1.MsgExec"},{"key":"sender","value":"%[1]s"}]}]}],"timestamp":"%[17]s"}`,
			ADDR_01_LIKE, ADDR_02_LIKE,
			recordNotes, fingerprintsA[0], string(stakeholdersA[0].Data), contentMetadata,
			recordNotes, fingerprintsB[0], string(stakeholdersB[0].Data), contentMetadata,
			iscnIdA1, iscnIdPrefixA, ipld,
			iscnIdB1, iscnIdPrefixB, ipld,
			timestamp.UTC().Format(time.RFC3339),
		),
	}
	InsertTestData(DBTestData{
		Txs: txs,
	})

	finished, err := Extract(Conn, ExtractFunc)
	require.NoError(t, err)
	require.True(t, finished)

	page := PageRequest{Limit: 10}
	res, err := QueryIscn(Conn, IscnQuery{}, page)
	require.NoError(t, err)
	require.Len(t, res.Records, 2)

	require.Equal(t, iscnIdA1, res.Records[0].Data.Id)
	require.Equal(t, iscnIdB1, res.Records[1].Data.Id)
}

func TestEventContextFromAuthzClone(t *testing.T) {
	originalCtx := EventContext{
		Batch:     nil,
		Timestamp: time.Unix(123456789, 0),
		Messages:  []json.RawMessage{json.RawMessage(`{"msgs":[]}`)},
		EventsList: EventsList{
			struct {
				Events types.StringEvents `json:"events"`
			}{
				Events: nil,
			},
		},
		TxHash: "txhash",
		Memo:   "memo",
	}
	clonedCtx, err := EventContextFromAuthz(originalCtx, 0)
	require.NoError(t, err)
	require.Equal(t, originalCtx.Timestamp, clonedCtx.Timestamp)
	require.Equal(t, originalCtx.TxHash, clonedCtx.TxHash)
	require.Equal(t, originalCtx.Memo, clonedCtx.Memo)
	require.Equal(t, &originalCtx, clonedCtx.AuthzParent)
}
